func download(filename string, url string) error {
  w, err := os.Create(filename)
  if err != nil {
    return err
  }
  defer w.Close()

  r, err := http.Get(url)
  if err != nil {
    return err
  }
  defer r.Body.Close()

  if _, err := io.Copy(w, r.Body); err != nil {
    return err
  }

  return nil
}

const path = "pub/c"

func main() {
  urls := []string{}
  if err := json.NewDecoder(bytes.NewBufferString(data)).Decode(&urls); err != nil {
    panic(err)
  }

  if _, err := os.Stat(path); os.IsNotExist(err) {
    if err := os.Mkdir(path, 0755); err != nil {
      panic(err)
    }
  }

  for _, v := range urls {
    if v[len(v)-6:] != "_b.jpg" {
      panic(fmt.Sprintf("Invalid name: %s", v))
    }

    v = fmt.Sprintf("%s_c.jpg", v[0:len(v)-6])

    u, err := url.Parse(v)
    if err != nil {
      panic(err)
    }

    p := filepath.Join(path, filepath.Base(u.Path))
    fmt.Printf("%s\n  -> %s\n", v, p)
    if err := download(p, v); err != nil {
      panic(err)
    }
  }
}
